import React from 'react';
import TopBar from './components/TopBar.js';
import MainPage from './components/MainPage.js';
import './App.css';

function App() {
  return (
    <div className="App">
      <TopBar/>
      <header className="App-header">
        <MainPage/>
      </header>
    </div>
  );
}

export default App;
